import{_ as t,a}from"./chunks/kakuteh7v2_bottom.CxxvYl1G.js";import{_ as e,c as d,o as r,ab as l}from"./chunks/framework.CUflZczI.js";const f=JSON.parse('{"title":"Holybro Kakute H7 V2","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/kakuteh7v2.md","filePath":"uk/flight_controller/kakuteh7v2.md"}'),o={name:"uk/flight_controller/kakuteh7v2.md"},i=l('<h1 id="holybro-kakute-h7-v2" tabindex="-1">Holybro Kakute H7 V2 <a class="header-anchor" href="#holybro-kakute-h7-v2" aria-label="Permalink to &quot;Holybro Kakute H7 V2&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не виробляє цей (або будь-який інший) автопілот. Звертайтесь до <a href="https://holybro.com/" target="_blank" rel="noreferrer">виробника</a> щодо питань апаратного забезпечення або питань відповідності.</p></div><p>Польотний контролер <a href="https://holybro.com/collections/autopilot-flight-controllers/products/kakute-h7-v2" target="_blank" rel="noreferrer">Holybro Kakute H7 V2</a> має багато різних функцій, включаючи інтегрований Bluetooth, роз&#39;єм для HD-камери, подвійні роз&#39;єми ESC 4in1 plug-and-play, VTX ON/OFF Pit Switch на 9В, барометр, OSD, 6x UART, 128 МБ сховище для ведення журналу (ще не підтримується PX4), BEC на 5В та 9В, більші площі для паяння та багато іншого.</p><p>Kakute H7v2 базується на кращих рисах своїх попередників, <a href="./../flight_controller/kakutef7.html">Kakute F7</a>, та <a href="./../flight_controller/kakuteh7.html">Kakute H7</a>.</p><p>Плата також має вбудований барометр, світлодіод &amp; п&#39;єзоімпульс, а також плату I2C (SDA &amp; SCL) для зовнішніх GPS/магнітомерів.</p><p><img src="'+t+'" width="300px" title="KakuteH7V2 Top Image"> <img src="'+a+'" width="300px" title="KakuteH7V2 Bottom Image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Цей польотний контролер підтримується <a href="./../flight_controller/autopilot_manufacturer_supported.html">виробником</a>.</p></div><h2 id="основні-характеристики" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2><ul><li>MCU: Процесор STM32H743 32-біт, що працює на частоті 480 МГц</li><li>IMU: BMI270</li><li>Барометр: BMP280</li><li>OSD: AT7456E</li><li>Bluetooth-чіп на борту: вилучено з PX4</li><li>VTX On/Off Pit Switch: Не використовується з PX4</li><li>6x UARTs (1,2,3,4,6,7; UART2 використовується для Bluetooth телеметрії)</li><li>9x PWM виходів (8 виходів двигуна, 1 LED)</li><li>2x порт JST-SH1.0_8pin (для одиночних або 4-в-1 ESCs, сумісний з x8/Octocopter plug &amp; play)</li><li>1x порт JST-GH1.5_6pin (для HD-системи, такої як Caddx Vista &amp; Air Unit)</li><li>Напруга вхідної батареї: 2S-8S</li><li>BEC 5V 2A Cont.</li><li>BEC 9V 1.5A Cont.</li><li>Монтаж: 30.5 х 30.5 мм / отвір Φ4 мм з люверсами Φ3 мм</li><li>Розміри: 35 x 35мм</li><li>Вага: 8г</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Плату можна придбати в одному з наступних магазинів (наприклад):</p><ul><li><a href="https://holybro.com/products/kakute-h7-v2" target="_blank" rel="noreferrer">Holybro</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><em>Kakute H7v2</em> призначений для сумісної роботи з <em>Tekko32</em> 4-in-1 ESC і може бути придбаний в комплекті.</p></div><h2 id="конектори-та-контакти" tabindex="-1">Конектори та контакти <a class="header-anchor" href="#конектори-та-контакти" aria-label="Permalink to &quot;Конектори та контакти&quot;">​</a></h2><table><thead><tr><th>Контакт</th><th>Функція</th><th>PX4 default</th></tr></thead><tbody><tr><td>B+</td><td>Позитивна напруга батареї (2S-8S)</td><td></td></tr><tr><td>VTX+</td><td>9В вивід</td><td></td></tr><tr><td>SDA, SCL</td><td>Підключення I2C (для периферійних пристроїв)</td><td></td></tr><tr><td>5V</td><td>Вихід 5В (максимум 2A)</td><td></td></tr><tr><td>3V3</td><td>Вихід 3.3В (максимум 0.25A)</td><td></td></tr><tr><td>VI</td><td>Відеовхід з камери FPV</td><td></td></tr><tr><td>VO</td><td>Відеовихід на відеопередавач</td><td></td></tr><tr><td>CAM</td><td>Контроль OSD камери</td><td></td></tr><tr><td>G or GND</td><td>Заземлення</td><td></td></tr><tr><td>RSI</td><td>Аналоговий вхід RSSI (0-3,3 В) від приймача</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX та TX</td><td>TELEM1</td></tr><tr><td>R3, T3</td><td>UART3 RX та TX</td><td>Консоль відлагодження NuttX</td></tr><tr><td>R4, T4</td><td>UART4 RX та TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX та TX (R6 також розташований в GH plug)</td><td>RC порт</td></tr><tr><td>R7</td><td>UART7 RX (RX знаходиться у роз&#39;ємах для використання з 4-in-1 ESC)</td><td>Телеметрія DShot</td></tr><tr><td>LED</td><td>Дріт сигнальний для адресованих світлодіодів WS2182 (не тестувався)</td><td></td></tr><tr><td>Z-</td><td>Негативна нога п&#39;єзожучка (Підключіть позитивну ногу до контакту 5В)</td><td></td></tr><tr><td>M1 to M4</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-in-1 ESC)</td><td></td></tr><tr><td>M5 to M8</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-in-1 ESC)</td><td></td></tr><tr><td>Boot</td><td>Кнопка завантажувача</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="оновлення-завантажувача-px4" tabindex="-1">Оновлення завантажувача PX4 <a class="header-anchor" href="#оновлення-завантажувача-px4" aria-label="Permalink to &quot;Оновлення завантажувача PX4&quot;">​</a></h2><p>Плата поставляється із заздалегідь встановленою <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Перед встановленням прошивки PX4 необхідно прошити <em>заванажувач PX4</em>. Завантажте завантажувальний бінарний файл <a href="https://github.com/PX4/PX4-user_guide/raw/v1.15/assets/flight_controller/kakuteh7v2/holybro_kakuteh7v2_bootloader.hex" target="_blank" rel="noreferrer">holybro_kakuteh7v2_bootloader.hex</a> та прочитайте <a href="./../advanced_config/bootloader_update_from_betaflight.html">цю сторінку</a> для інструкцій з прошивки.</p><h2 id="створення-прошивки" tabindex="-1">Створення прошивки <a class="header-anchor" href="#створення-прошивки" aria-label="Permalink to &quot;Створення прошивки&quot;">​</a></h2><p>Щоб <a href="./../dev_setup/building_px4.html">зібрати PX4</a> для цього контролера:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make holybro_kakuteh7v2_default</span></span></code></pre></div><h2 id="встановлення-прошивки-px4" tabindex="-1">Встановлення прошивки PX4 <a class="header-anchor" href="#встановлення-прошивки-px4" aria-label="Permalink to &quot;Встановлення прошивки PX4&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>KakuteH7v2 підтримується з PX4 master &amp; PX4 v1.14 або новішою. Якщо ви завантажуєте готове програмне забезпечення через QGroundcontrol, вам необхідно використовувати щоденну версію QGC або версію QGC новішу за 4.1.7. До випуску вам потрібно буде вручну зібрати та встановити прошивку.</p></div><p>Прошивку можна встановити вручну будь-якими звичайними способами:</p><ul><li><p>Джерело для збірки та завантаження:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make holybro_kakuteh7v2_default upload</span></span></code></pre></div></li><li><p><a href="./../config/firmware.html">Завантажте прошивку</a> за допомогою <em>QGroundControl</em>. Ви можете використовувати або готове вбудоване програмне забезпечення, або власне користувацьке програмне забезпечення.</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>KakuteH7v2 підтримується з PX4 main і v1.14 або новішою.</p></div><h2 id="налаштування-px4" tabindex="-1">Налаштування PX4 <a class="header-anchor" href="#налаштування-px4" aria-label="Permalink to &quot;Налаштування PX4&quot;">​</a></h2><p>Крім <a href="./../config/">основної конфігурації</a>, важливі наступні параметри:</p><table><thead><tr><th>Параметр</th><th>Налаштування</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>Це має бути вимкнено, оскільки у платі немає внутрішнього магніту. Ви можете активувати це, якщо приєднаєте зовнішній магніт.</td></tr></tbody></table><h2 id="зіставлення-послідовних-портів" tabindex="-1">Зіставлення послідовних портів <a class="header-anchor" href="#зіставлення-послідовних-портів" aria-label="Permalink to &quot;Зіставлення послідовних портів&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>Debug Console</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>ESC telemetry (DShot)</td></tr></tbody></table><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><h3 id="системна-консоль" tabindex="-1">Системна консоль <a class="header-anchor" href="#системна-консоль" aria-label="Permalink to &quot;Системна консоль&quot;">​</a></h3><p>UART3 RX та TX налаштовані для використання як <a href="./../debug/system_console.html">Системна Консоль</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>Інтерфейс <a href="./../debug/swd_debug.html">SWD</a> (JTAG) має такі контакти:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: Як позначено на платі</li><li><code>VDD_3V3</code>: Як позначено на платі</li></ul>',37),h=[i];function s(n,c,p,u,b,k){return r(),d("div",null,h)}const S=e(o,[["render",s]]);export{f as __pageData,S as default};
